import React, { Component } from 'react';

class CycleC extends Component {
    render() {
        let load = (this.props.weight-this.props.bar);

        return (
            <ul>
                <div className='container'
                     style={{display: this.props.isToggle? 'block' : 'none'}}>
                    <div>40% Warmup Set 1 x 5x : {Math.round(load*4/10).toFixed(1)}kg</div>
                    <div>50% Warmup Set 2 x 5x : {Math.round((load)*5/10).toFixed(1)}kg</div>
                    <div>60% Warmup Set 3 x 3x : {Math.round((load)*6/10).toFixed(1)}kg</div>
                </div>

                <div>75% Working Set 1 5x {Math.round(load*75/100).toFixed(1)}kg</div>
                <div>85% Working Set 2 5x {Math.round(load*85/100).toFixed(1)}kg</div>
                <div>95% Working Set 3 5x+ {Math.round(load*95/100).toFixed(1)}kg</div>
            </ul>
            )
    }
}

export default CycleC;
